    val video_flag = value.get("video_txPkts") match {
      case Some(x: Long) => if(x >=0) true else false
      case Some(_) => false
      case None => false
    }

    val total_flag = value.get("total_txPkts") match {
      case Some(x: Long) => if(x >=0) true else false
      case Some(_) => false
      case None => false
    }

    val tx_flag = value.get("total_txBw") match {
      case Some(x: Double) => if(x > 0.0D && x < 3000000D) true else false
      case Some(_) => false
      case None => false
    }

     val st_flag = value.get("total_streamType") match {
      case Some(x: Integer) => if( x == 1 ||  x == 2) false else true
      case Some(_) => false
      case None => false
    }


    if (video_flag && total_flag && tx_flag && st_flag){
      true
    } else {
      false
    }
  }

  // 打开操作
  override def open(parameters: Configuration): Unit = {
  }

  // 关闭操作
  override def close(): Unit = {
  }
}

