  //TODO 变量定义
  override def process(value: RichMap): RichMap = {
    //TODO 业务逻辑
    val a: String = value.get("a").getOrElse("").toString
    val b: String = value.get("b").getOrElse("").toString
    val print_time: String = a + " " + b

    val c: String = value.get("c").getOrElse("").toString
    val regex: Regex = new Regex("^*[a-zA-Z0-9]{16}")
    val traceId = regex.findFirstIn(c).getOrElse("")

    val g: String = value.get("g").getOrElse("").toString
    val gStr: String = g.split(":")(1)
    val dataCenterId: String = gStr.substring(0, gStr.length - 1)

    val h: String = value.get("h").getOrElse("").toString
    val hId: String = h.split(":")(1)
    val eventId: String = hId.substring(0, hId.length - 1)

    val data: String = value.get("i").getOrElse("").toString

    val _value = if (value.contains("@metadata")) {
      value + ("log_from" -> "cloud")
    } else if (value.contains("agent")) {
      value + ("log_from" -> "mix-cloud")
    } else {
      value
    }
    _value - ("a") - ("b") - ("c") - ("d") - ("e") - ("f") -
      ("g") - ("h") - ("h") - ("i") - ("j") - ("c@path") -
      ("c@receive_time") - ("@metadata") - ("beat") - ("host") -
      ("hostname") - ("idc_") - ("input") - ("prospector") - ("@timestamp") -
      ("source") - ("topic") - ("namespace") - ("agent") - ("ecs") - ("log") - ("@version") +
      ("data" -> data) + ("trace_id" -> traceId) + ("idc" -> dataCenterId) +
      ("event_id" -> eventId) + ("print_time" -> print_time)


  }
}

